pragma solidity ^ 0.4.25;

import './Interfaces.sol';
import './Helpers.sol';
import './Libs.sol';

contract Settings is ISettings, HasAdminController {
    using SafeMath for uint256;

    address systemUser;

    bool paused;

    uint256 bidDiscountPercent;
    uint256 fodrDiscountPercent;
    uint256 fodrBurningCountOnUpdate;
    mapping(uint256 => uint256) packagePrices;
    mapping(uint256 => uint256) priceCurrencyMultiplier;


    constructor() public {
        paused = false;
        bidDiscountPercent = 450; //%4.5
        fodrDiscountPercent = 1000; //%10
        fodrBurningCountOnUpdate = 1000000000000;
        packagePrices[1] = 100000;
        packagePrices[2] = 200000;
        packagePrices[3] = 300000;
        priceCurrencyMultiplier[1] = 1;
        priceCurrencyMultiplier[2] = 100;

    }

    //systemUser
    function getSystemUser() public view returns(address) {
        return systemUser;
    }

    function setSystemUser(address _systemUser) __onlyAdmin public {
        systemUser = _systemUser;
    }

    //paused
    function getPaused() public view returns(bool) {
        return paused;
    }

    function setPaused(bool _paused) __onlyAdmin public {
        paused = _paused;
    }

    //bidDiscountPercent
    function getBidDiscountPercent() public view returns(uint256) {
        return bidDiscountPercent;
    }

    function setBidDiscountPercent(uint256 _bidDiscountPercent) __onlyAdmin public {
        bidDiscountPercent = _bidDiscountPercent;
    }

    //fodrDiscountPercent
    function getFodrDiscountPercent() public view returns(uint256) {
        return fodrDiscountPercent;
    }

    function setFodrDiscountPercent(uint256 _fodrDiscountPercent) __onlyAdmin public {
        fodrDiscountPercent = _fodrDiscountPercent;
    }

    //fodrBurningCountOnUpdate
    function getFodrBurningCountOnUpdate() public view returns(uint256) {
        return fodrBurningCountOnUpdate;
    }

    function setFodrBurningCountOnUpdate(uint256 _fodrBurningCountOnUpdate) __onlyAdmin public {
        fodrBurningCountOnUpdate = _fodrBurningCountOnUpdate;
    }

    //packagePrices
    function getPackagePrice(uint256 _packageType) public view returns(uint256) {
        return packagePrices[_packageType];
    }

    function setPackagePrice(uint256 _packageType, uint256 _packagePrice) __onlyAdmin public {
        packagePrices[_packageType] = _packagePrice;
    }

    //priceCurrencyMultiplier
    function getPriceCurrencyMultiplier(uint256 _currencyType) public view returns(uint256) {
        return priceCurrencyMultiplier[_currencyType];
    }

    function setPriceCurrencyMultiplier(uint256 _currencyType, uint256 _priceCurrencyMultiplier) __onlyAdmin public {
        priceCurrencyMultiplier[_currencyType] = _priceCurrencyMultiplier;
    }

}
